import { Button, Card, CardContent, Grid2, TextField, Typography, MenuItem, Select, FormControl, InputLabel } from "@mui/material"

function ListaUsuarios() {
  return (
    <><Grid2 container direction="colum" alignItems='center' justifyContent='center' /><Grid2 item xs={1} /><Card sx={{ mt: 10 }} style={{
      backgroundColor: '#1e272e',
      padding: "1rem"
    }} /><Typography variant="5" textAlign="center" color="white">
        Crear un Usuario
      </Typography></>
  )
}

export default ListaUsuarios
